// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

library SafeMath {
    function multiply(uint256 a, uint256 b) internal pure returns (uint256) {
        // Gas optimization: this is cheaper than requiring 'a' == 0 || 'b' == 0 but less helpful
        // (in case one of them is zero, the result is zero anyway, so we save gas).
        // If you require 'a' == 0 || 'b' == 0, please add a comment why you do it.
        if (a == 0) {
            return 0;
        }
        uint256 c = a * b;
        require(c / a == b, "Multiplication overflow");
        return c;
    }
}

contract Calculator {
    uint32 public result = 0; // Made 'result' public so you can easily read it

    using SafeMath for uint256;

    function add(uint32 num) public {
        result += num;
    }

    function subtract(uint32 num) public { // Corrected the spelling
        result -= num;
    }

    function multiply() public { // Removed the unused parameter and made it multiply by 4801
        result = uint32(uint256(result).multiply(4801));
        require(result / 4801 == result, "Multiplication overflow in Calculator"); // Added a check within the contract
    }

    function getResult() public view returns (uint32) { // Renamed 'get' to 'getResult' for clarity
        return result;
    }
}

